INSERT INTO `Blog__main_post` VALUES (5,'Python','About Python','about-python','<p>A few words about Python.</p>','<p style=\"text-align: justify;\">A high-level general-purpose programming language with dynamic strict typing and automatic memory management, aimed at improving developer productivity, code readability and quality, as well as ensuring the portability of programs written in it.</p>\r\n\r\n<p style=\"text-align: justify;\">The language is completely object-oriented in the sense that everything is objects.</p>\r\n\r\n<p style=\"text-align: justify;\">An unusual feature of the language is the indentation of code blocks.</p>\r\n\r\n<p style=\"text-align: justify;\">The syntax of the language core is minimalistic, due to which in practice there is rarely a need to refer to documentation.</p>','IMG/Python_logo.png','2024-01-05 11:12:03.816934',1),(6,'Webpack','About Webpack','about-webpack','<p>A few words about Webpack.</p>','<p style=\"text-align: justify;\">At its core,&nbsp;<strong>webpack</strong>&nbsp;is a&nbsp;<em>static module bundler</em>&nbsp;for modern JavaScript applications. When webpack processes your application, it internally builds a dependency graph from one or more&nbsp;<em>entry points</em>&nbsp;and then combines every module your project needs into one or more&nbsp;<em>bundles</em>, which are static assets to serve your content from.</p>\r\n\r\n<p style=\"text-align: justify;\">Its main purpose is to bundle JavaScript files for usage in a browser, yet it is also capable of transforming, bundling, or packaging just about any resource or asset.</p>','IMG/Webpack_logo.png','2024-01-05 11:34:30.489872',1),(7,'JavaScript','About JavaScript','about-javascript','<p>A few words about JavaScript.</p>','<p style=\"text-align: justify;\">JavaScript is a multi&mdash;paradigm programming language. Supports object-oriented, imperative, and functional styles.&nbsp;This is the third layer of the layer cake of standard web technologies: HTML, CSS and JS.</p>\r\n\r\n<p style=\"text-align: justify;\">JavaScript is a language that allows you to apply complex things on a web page &mdash; every time something more than just its static display occurs on a web page - displaying periodically updated content, or interactive maps, or animation of 2D/3D graphics, or scrolling videos in a player, etc. &mdash; you can be we are sure that most likely it was not without JavaScript.</p>\r\n\r\n<p style=\"text-align: justify;\">A release using ECMAScript (ECMA-262 standard) is used.</p>','IMG/JavaScript_logo.png','2024-01-05 11:36:06.329121',1),(8,'MySQL','About MySQL','about-mysql','<p>A few words about MySQL.</p>','<p style=\"text-align: justify;\">A free relational database management system.</p>\r\n\r\n<p style=\"text-align: justify;\">MySQL is developed and supported by Oracle Corporation, which acquired the Swedish company MySQL AB.</p>\r\n\r\n<p style=\"text-align: justify;\">The product is distributed both under the GNU General Public License and under its own commercial license.</p>\r\n\r\n<p style=\"text-align: justify;\">MySQL is a solution for small and medium-sized applications. It is usually used as a server accessed by local or remote clients. However, the distribution package includes an internal server library that allows you to include MySQL in standalone programs.</p>','IMG/MySQL_logo.png','2024-01-05 11:37:30.172472',1),(9,'Bootstrap5','About Bootstrap5','about-bootstrap5','<p>A few words about Bootstrap5.</p>','<p style=\"text-align: justify;\">A free set of tools for creating websites and web applications.</p>\r\n\r\n<p style=\"text-align: justify;\">It includes HTML and CSS design templates for typography, web forms, buttons, labels, navigation blocks and other web interface components, including JavaScript extensions.</p>\r\n\r\n<p style=\"text-align: justify;\">Bootstrap uses modern developments in CSS and HTML, so you need to be careful when supporting older browsers.</p>','IMG/Bootstrap_logo.png','2024-01-05 11:40:01.148184',1),(10,'NuxtJS','About NuxtJS','about-nuxtjs','<p>A few words about NuxtJS.</p>','<p style=\"text-align: justify;\">A high-level framework based on Vue.js, which allows you to develop isomorphic web applications out of the box, abstracting the details of the distribution of server and client code.</p>\r\n\r\n<p style=\"text-align: justify;\">NuxtJS is one of the fastest growing frameworks for developing VueJS applications. The ability to choose what type of application you can create with it (universal, static generation or single page applications) is one of its unique features.</p>\r\n\r\n<p style=\"text-align: justify;\">Since its initial release, it has gathered a lot of attention from the JavaScript community. The VueJS community deeply backs this tool that helps developers build server-side rendered applications using VueJS without in-depth technical know-how.</p>','IMG/NuxtJS_logo.png','2024-01-05 11:41:26.596245',1),(12,'CSS','About css','about-css','<p>A few words about CSS.</p>','<p style=\"text-align: justify;\">Cascading Style Sheets (CSS) is a stylesheet language used to describe the presentation of a document written in HTML or XML. CSS describes how elements should be rendered on screen, on paper, in speech, or on other media.</p>\r\n\r\n<p style=\"text-align: justify;\">CSS is among the core languages of the open web and is standardized across Web browsers according to W3C specifications. Previously, the development of various parts of CSS specification was done synchronously, which allowed the versioning of the latest recommendations. You might have heard about CSS1, CSS2.1, or even CSS3. There will never be a CSS3 or a CSS4; rather, everything is now CSS without a version number.</p>\r\n\r\n<p style=\"text-align: justify;\">After CSS 2.1, the scope of the specification increased significantly and the progress on different CSS modules started to differ so much, that it became more effective to develop and release recommendations separately per module. Instead of versioning the CSS specification, W3C now periodically takes a snapshot of the latest stable state of the CSS specification and individual modules progress.</p>','IMG/CSS_logo.png','2024-01-24 12:46:47.722287',1),(13,'HTML','About HTML','about-html','<p>A few words about HTML.</p>','<p style=\"text-align: justify;\">HTML (HyperText Markup Language) is a standardized hypertext markup language for documents for viewing web pages in a browser.</p>\r\n\r\n<p style=\"text-align: justify;\">Web browsers receive an HTML document from the server via HTTP/HTTPS protocols or open it from a local disk, then interpret the code into an interface that will be displayed on the monitor screen.</p>\r\n\r\n<p style=\"text-align: justify;\">For example, content can be structured within multiple paragraphs, bulleted lists, or using images and data tables.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">HTML is not a programming language; it is a markup language, and is used to tell your browser how to display the web pages you visit. It can be complex or simple, depending on how the web designer wants it. HTML consists of a number of elements that you use to embed or wrap various parts of the content to make the content appear or act in a certain way. Enclosing tags can make a word or image a link to something else, they can make words italicized, make the font larger or smaller, and so on.</p>','IMG/HTML_logo.png','2024-01-24 13:01:59.466192',1),(14,'Docker','About Docker','about-docker','<p>A few words about Docker.</p>','<p style=\"text-align: justify;\">Docker is software for automating the deployment and management of applications in environments with support for application containerization.</p>\r\n\r\n<p style=\"text-align: justify;\">It allows you to &quot;package&quot; an application with all its environment and dependencies into a container that can be deployed on any Linux system with support for control groups in the kernel, and also provides a set of commands for managing these containers.</p>\r\n\r\n<p style=\"text-align: justify;\">Containers do not create such an additional load, so you can use the system and resources more efficiently with them.</p>','IMG/Docker_logo.png','2024-01-24 13:22:39.716292',1),(15,'SASS','About SASS','about-sass','<p>A few words about SASS.</p>','<p style=\"text-align: justify;\">Sass (SCSS) is a CSS preprocessor that allows you to embed CSS rules into each other, work with variables, write your own functions and use mixins to create separate themes of the same layout.</p>\r\n\r\n<p style=\"text-align: justify;\">Sass is not dynamic. You will not be able to generate and/or animate CSS properties and values in real time. But you can create them in a more efficient way and allow standard properties (like CSS animations) to borrow them from there.</p>','IMG/Sass_logo.png','2024-01-24 13:27:14.577417',1);
